  false,\n\t\"url\": null,\n\t\"notes\": \"This plan discusses approaches to managing
  furbearer populations; specifically, management strategies, trapping programs and
  methods. The Upper Mississippi NWFR believes that it is important to maintain furbearer
  populations at levels compatible with the waterfowl management. The Refuge stated
  the following goals which relate to management of furbearers; to provide the life
  requirements of waterfowl and other migratory birds occurring naturally along the
  Upper Mississippi River, to conserve and enhance the habitats of fish and other
  aquatic plant and animals life for the continuing benefit of people, to provide
  the life requirements of resident wildlife species, and to gain active public support
  for the preservation of the vulnerable floodplain ecosystem by providing interpretation
  and education opportunities.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
